onfinish:
try{
                     if(document.getElementsByClassName('link')[0] != undefined){
                            location.replace(document.getElementsByClassName('link')[0].href);
                            window.HTMLOUT.changeDoit(true);
                     }else if(location.href.includes('tomate') ||
                                   location.href.includes('streamtape') ||
                                   location.href.includes('diasfem') ||
                                   location.href.includes('waaw')){
                            window.HTMLOUT.processHTML(location.href);
                     }else if(location.href.includes('index')){
                            document.getElementsByTagName('form')[0].submit();
                            window.HTMLOUT.changeDoit(true);
                     }else if(location.href.includes('goto')||location.href.includes('player.php')){
                            window.HTMLOUT.changeDoit(true);
                     }else{
                            window.HTMLOUT.getError();
                     }
              }catch(error){
                     window.HTMLOUT.getError();
              }
